import React, { useState } from 'react';
import { Zap, Database, BarChart, Users, Shield, Star, Activity, TrendingUp, Settings } from 'lucide-react';
import { Layout } from '../components/Layout';
import { useLanguage } from '../contexts/LanguageContext';
import { useTheme } from '../contexts/ThemeContext';

type TabType = 'overview' | 'system' | 'data-collection' | 'data-models';

export const IntroPage: React.FC = () => {
  const { t } = useLanguage();
  const { colors } = useTheme();
  const [activeTab, setActiveTab] = useState<TabType>('overview');

  // Îç∞Ïù¥ÌÑ∞ ÏàòÏßë ÏãúÎÆ¨Î†àÏù¥ÌÑ∞ ÏÉÅÌÉú
  const [isSimulating, setIsSimulating] = useState(false);
  const [userLogs, setUserLogs] = useState<any[]>([]);
  const [eventLogs, setEventLogs] = useState<any[]>([]);
  const [currentAction, setCurrentAction] = useState<string>('');
  const [logCount, setLogCount] = useState(0);

  // ÌÖåÎßà ÏÉâÏÉÅ Í∞ÄÏ†∏Ïò§Í∏∞
  const theme = colors;

  const tabs = [
    {
      id: 'overview' as TabType,
      title: 'Í∏∞Î≥∏ ÏÜåÍ∞ú',
      icon: <Shield size={20} />,
      color: '#8b5cf6'
    },
    {
      id: 'system' as TabType,
      title: 'ÏãúÏä§ÌÖú Íµ¨Ï°∞',
      icon: <Settings size={20} />,
      color: '#3b82f6'
    },
    {
      id: 'data-collection' as TabType,
      title: 'Îç∞Ïù¥ÌÑ∞ ÏàòÏßëÏùò Ïù¥Ìï¥',
      icon: <Activity size={20} />,
      color: '#10b981'
    },
    {
      id: 'data-models' as TabType,
      title: 'Îç∞Ïù¥ÌÑ∞ Î™®Îç∏Ïùò ÌôúÏö©',
      icon: <TrendingUp size={20} />,
      color: '#f59e0b'
    }
  ];

  const renderOverviewTab = () => (
    <div>
      {/* Í≤åÏù¥Î∞ç Ïä§ÌÉÄÏùº Ìó§Îçî */}
      <div style={{ 
        background: theme.cardBg,
        backdropFilter: 'blur(20px)',
        borderRadius: '24px',
        padding: '48px',
        marginBottom: '32px',
        border: `1px solid ${theme.cardBorder}`,
        boxShadow: '0 20px 40px rgba(0, 0, 0, 0.3)',
        position: 'relative',
        overflow: 'hidden',
        textAlign: 'center'
      }}>
        {/* Î∞∞Í≤Ω Ïû•Ïãù */}
        <div style={{
          position: 'absolute',
          top: '-30%',
          left: '-10%',
          width: '150px',
          height: '150px',
          background: 'linear-gradient(135deg, rgba(139, 92, 246, 0.1), rgba(59, 130, 246, 0.1))',
          borderRadius: '50%',
          filter: 'blur(40px)'
        }} />

        <div style={{ position: 'relative', zIndex: 1 }}>
          <div style={{
            width: '80px',
            height: '80px',
            background: 'linear-gradient(135deg, #8b5cf6, #3b82f6)',
            borderRadius: '20px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            margin: '0 auto 24px',
            boxShadow: '0 12px 30px rgba(139, 92, 246, 0.4)'
          }}>
            <Zap size={40} color="white" />
          </div>

          <h1 style={{ 
            fontSize: '42px', 
            fontWeight: '800', 
            background: 'linear-gradient(135deg, #8b5cf6, #3b82f6)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            margin: '0 0 16px 0',
            lineHeight: '1.2'
          }}>
            Thinking Engine
          </h1>

          <p style={{ 
            fontSize: '20px', 
            color: theme.textSecondary,
            lineHeight: '1.6',
            maxWidth: '800px',
            margin: '0 auto 32px'
          }}>
            ÏîΩÌÇπÎç∞Ïù¥ÌÑ∞(ThinkingData)Í∞Ä Í∞úÎ∞úÌïú 'ÏîΩÌÇπ ÏóîÏßÑ(Thinking Engine)'ÏùÄ ÏÇ¨Ïö©Ïûê ÌñâÎèô Îç∞Ïù¥ÌÑ∞Î•º Í∏∞Î∞òÏúºÎ°ú Ïã¨Ï∏µÏ†ÅÏù∏ Î∂ÑÏÑùÍ≥º Ïã§Ìñâ Í∞ÄÎä•Ìïú Ïù∏ÏÇ¨Ïù¥Ìä∏Î•º Ï†úÍ≥µÌïòÎäî ÏõêÏä§ÌÜ± Îç∞Ïù¥ÌÑ∞ ÌîåÎû´ÌèºÏûÖÎãàÎã§.
          </p>

          {/* Ï£ºÏöî ÌÜµÍ≥Ñ */}
          <div style={{
            display: 'flex',
            justifyContent: 'center',
            gap: '48px',
            marginTop: '32px',
            flexWrap: 'wrap'
          }}>
            {[
              { label: 'Í≥†Í∞ùÏÇ¨', value: '1,500+', color: '#10b981', icon: <Users size={20} /> },
              { label: 'Ïó∞Í≤∞Îêú ÌîÑÎ°úÎçïÌä∏', value: '8,000+', color: '#8b5cf6', icon: <Database size={20} /> },
              { label: 'Í≥†Í∞ù ÎßåÏ°±ÎèÑ', value: '98%', color: '#f59e0b', icon: <Star size={20} /> }
            ].map((stat, index) => (
              <div key={index} style={{ textAlign: 'center' }}>
                <div style={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  gap: '8px',
                  marginBottom: '8px',
                  color: stat.color
                }}>
                  {stat.icon}
                  <div style={{
                    fontSize: '28px',
                    fontWeight: '800',
                    color: stat.color,
                    textShadow: `0 0 10px ${stat.color}40`
                  }}>
                    {stat.value}
                  </div>
                </div>
                <div style={{
                  fontSize: '14px',
                  color: theme.textSecondary,
                  fontWeight: '500'
                }}>
                  {stat.label}
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* ÌïµÏã¨ Í∏∞Îä• */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))',
        gap: '24px',
        marginBottom: '32px'
      }}>
        {[
          {
            icon: <BarChart size={32} />,
            title: 'Îã§Í∞ÅÏ†ÅÏù∏ Îç∞Ïù¥ÌÑ∞ Î∂ÑÏÑù',
